const TabsContent = {
    FIRST: "FIRST",
    SECOND: "SECOND",
    THIRD: "THIRD",
    FOURTH: "FOURTH"
}

const NameTabs = [
    { value: TabsContent.FIRST, mainTitle: "Panel 1" },
    { value: TabsContent.SECOND, mainTitle: "Panel 2" },
    { value: TabsContent.THIRD, mainTitle: "Panel 3" },
    { value: TabsContent.FOURTH, mainTitle: "Panel 4" }
]

export { TabsContent, NameTabs }
